import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';

export const Interests = () => (
        <div className="container">
          <Jumbotron>
            <center><h1> Hobbies & Interests </h1></center>
            <p>
            I like d&d, the carillon, and the NBA.
            </p>
          </Jumbotron>
        </div>
)
